r($,"auA","mc",()=>A.a([A.a5L("Son kullan\u0131c\u0131 i\xe7in Linux Nedir, Ne De\u011fildir ?","assets/images/tux.png","Linux veya GNU/Linux; Windows 10, Android, IOS, OSX gibi bir i\u015fletim sistemidir. Tamamen \xfccretsiz olmas\u0131n\u0131n yan\u0131nda yeterli teknik bilgiye sahip olan insanlar\u0131n sistemi istedi\u011fi gibi e\u011fip b\xfckebilmesi i\xe7in kaynak kodlar\u0131n\u0131n tamam\u0131na yak\u0131n\u0131 insanl\u0131\u011fa a\xe7\u0131kt\u0131r. Eskiden son kullan\u0131c\u0131ya pek uygun olmasa da g\xfcn\xfcm\xfczde bu problem ortadan kalkm\u0131\u015ft\u0131r.\n\nNeden Linux kullanmal\u0131y\u0131m ?\n\n    \xc7\xfcnk\xfc h\u0131zl\u0131, ki\u015fiselle\u015ftirilebilir, g\xfcvenli ve bedava. Herhangi bir Linux i\u015fletim sistemini bilgisayar\u0131n\u0131za kurdu\u011funuzda bilgisayar\u0131n\u0131z\u0131n Windows'a g\xf6re daha h\u0131zl\u0131 oldu\u011funu ve daha g\xfczel g\xf6r\xfcnd\xfc\u011f\xfcn\xfc g\xf6zlemleyebilirsiniz. \xd6zellikle eski bir bilgisayar kullan\u0131yorsan\u0131z bilgisayar\u0131n\u0131z\u0131n hayata d\xf6nece\u011finin garantisini verebilirim, ben Linux ser\xfcvenime bu \u015fekilde ba\u015flam\u0131\u015ft\u0131m ve a\u015f\u0131r\u0131 memnun kalm\u0131\u015ft\u0131m.\n\nPeki neden \xfccretsiz ?\n\n   Bir \xfcr\xfcn\xfcn bedava olmas\u0131 onun \xe7o\u011fu zaman kalitesiz veya tehlikeli oldu\u011fuyla \xf6zde\u015fle\u015ftirilir ve \u015fahsen \xe7o\u011funlukla ben de \xf6yle d\xfc\u015f\xfcn\xfcr\xfcm ama Linux'teki durum b\xf6yle de\u011fil. \xdccretsiz olmas\u0131n\u0131n sebebini a\xe7\u0131klamak i\xe7in Gnu ve Linux'un tarih\xe7esine biraz de\u011finmem gerek.\n    \n    Hikayemiz 1983 y\u0131l\u0131nda Richard Stallman ad\u0131ndaki bir \u015fahs\u0131n Kom\xfcnist Manifesto vari bir bildirge yay\u0131nlamas\u0131yla; tamamen \xfccretsiz, kaynak kodlar\u0131 kamuya tamamen a\xe7\u0131k bir i\u015fletim sistemi yaratmak i\xe7in insanlardan destek istemesiyle ba\u015flam\u0131\u015ft\u0131. GNU ad\u0131ndaki bu i\u015fletim sistemi yava\u015f\xe7a bir harekete d\xf6n\xfc\u015fm\xfc\u015f, D\xfcnyan\u0131n her yan\u0131ndan insanlar bu projeye destek olmu\u015ftu. 90'l\u0131 y\u0131llara kadar i\u015fletim sisteminin \xe7ekirde\u011fi -bilgisayar\u0131n donan\u0131m\u0131 ile yaz\u0131l\u0131m\u0131 aras\u0131ndaki k\xf6pr\xfcy\xfc kuran yaz\u0131l\u0131m- hari\xe7 her \u015feyi tamamlanm\u0131\u015ft\u0131. 1991 y\u0131l\u0131nda da Linus Torvalds adl\u0131 bir \xfcniversite \xf6\u011frencisinin -ad\u0131 o zamanlar Linux olmayan- bir \xe7ekirdek yazmas\u0131 ve bunu internette payla\u015fmas\u0131 \xfczerine bu eksiklik ortadan kalkm\u0131\u015ft\u0131. Yani GNU/Linux 90'l\u0131 y\u0131llardan g\xfcn\xfcm\xfcze kadar g\xf6n\xfcll\xfcl\xfck esas\u0131yla bu projeye katk\u0131 sa\u011flayan milyonlarca insan\u0131n \xfcr\xfcn\xfcd\xfcr ve bu sebeple \xfccretsizdir.\n\nGNU/Linux ile Linux'un aras\u0131ndaki fark nedir ?\n\n    Bir\xe7ok insan GNU/Linux'tan bahsederken -benim bu yaz\u0131da kulland\u0131\u011f\u0131m gibi- sadece Linux'u kullan\u0131r. Asl\u0131nda Linux sadece bir \xe7ekirdek yaz\u0131l\u0131m\u0131d\u0131r ve GNU ara\xe7lar\u0131yla beraber Windows, OSX gibi bir i\u015fletim sistemine d\xf6n\xfc\u015f\xfcr. Bu y\xfczden bu i\u015fletim sisteminden bahsederken Linux i\u015fletim sistemi yerine GNU/Linux'u kullanmak daha do\u011frudur. Duyar meselesi anlayaca\u011f\u0131n\u0131z, kafan\u0131za g\xf6re tak\u0131l\u0131n :) Ama sadece Linux'u kullan\u0131yorsan\u0131z bile malum i\u015fletim sisteminin \xe7o\u011funu GNU'nun olu\u015fturdu\u011funu bilin.\n\nHarbiden g\xfcvenli mi bu meret ?\n\n    Evet \xf6yle. Windows'un bilgisayarlardaki pazar pay\u0131 olduk\xe7a y\xfcksek oldu\u011fu i\xe7in vir\xfcsler \xe7o\u011funlukla Windows i\xe7in yaz\u0131l\u0131r ve bu vir\xfcsler Linux kullan\u0131c\u0131lar\u0131na i\u015flemez. Tabi bu %100 g\xfcvende oldu\u011funuz anlam\u0131na gelmez, sadece bir Windows kullan\u0131c\u0131s\u0131na g\xf6re az\u0131c\u0131k daha g\xfcvende olmu\u015f olursunuz.\n\nOyun oynanabiliyor mu ?\n\n    Bu hangi oynu oynamak istedi\u011finize ba\u011fl\u0131. Bir\xe7ok oyun Linux'te oynanabilirken baz\u0131 oyunlar oynanamayabiliyor. \u015eansl\u0131ysan\u0131z oynamak istedi\u011finiz oyun direkt Steam vb platformlarda Linux'a portlanm\u0131\u015ft\u0131r, Windows 10'a g\xf6re biraz daha az performansla oynayabilirsiniz. Linux'a portlanmad\u0131ysa bile wine ad\u0131ndaki Windows emulat\xf6r\xfcyle biraz performans kayb\u0131 ile oynayabilirsiniz. Oynunuz \xe7al\u0131\u015fm\u0131yorsa birtak\u0131m zahmetli i\u015flerle u\u011fra\u015farak hala oynunuzu \xe7al\u0131\u015fabilir hale getirebilirsiniz. Oynunuz bunlara ra\u011fmen \xe7al\u0131\u015fm\u0131yorsa ge\xe7mi\u015f olsun o oyun Linux'te \xe7al\u0131\u015fm\u0131yordur. Bu yaz\u0131y\u0131 yazd\u0131\u011f\u0131m tarihte LoL, Valorant, Apex Legends gibi oyunlar anti-cheat sistemleri sebebiyle Linux'te oynanmayan oyunlardand\u0131r.\n\nLinux'u nereden indirebilirim ?\n\n    Bunun i\xe7in \xf6ncelikle bir Linux Da\u011f\u0131t\u0131m\u0131n\u0131n ne oldu\u011funu bilmeniz gerek. Linux \xe7ekirde\u011fini ve GNU ara\xe7lar\u0131n\u0131 birle\u015ftirerek olu\u015fturulmu\u015f bir i\u015fletim sistemine GNU/Linux veya Linux da\u011f\u0131t\u0131m\u0131 denir. Linux da\u011f\u0131t\u0131mlar\u0131n\u0131 ara\u015ft\u0131r\u0131rsan\u0131z y\xfczlerce Linux da\u011f\u0131t\u0131m\u0131n\u0131n oldu\u011funu g\xf6rebilirsiniz ve kafan\u0131z kar\u0131\u015fabilir. \xd6z\xfcnde \xe7o\u011fu ayn\u0131 \u015feydir ve baz\u0131 temel Linux da\u011f\u0131t\u0131mlar\u0131 esas al\u0131narak olu\u015fturulmu\u015flard\u0131r. bunlardan baz\u0131lar\u0131 Ubuntu, Debian, Fedora, Arch Linux gibi Linux da\u011f\u0131t\u0131mlar\u0131d\u0131r. Bunlar\u0131n herhangi birinin sitesine girebilir ve direkt indirebilirsiniz. \u0130lk defa b\xf6yle bir i\u015fe giri\u015fiyorsan\u0131z Linux Mint'i indirmenizi tavsiye ederim, a\u015f\u0131r\u0131 stabil ve kullan\u0131c\u0131 dostu bir da\u011f\u0131t\u0131md\u0131r kendileri. Windows kullan\u0131c\u0131s\u0131ysan\u0131z Rufus'u kullanarak herhangi bir usbye indirdi\u011finiz iso dosyas\u0131n\u0131 yazabilirsiniz. Kurulum i\xe7in kuraca\u011f\u0131n\u0131z da\u011f\u0131t\u0131m\u0131n sitesinden rehberlere ula\u015fabilirsiniz, onu da ben anlatmayay\u0131m art\u0131k siz ara\u015ft\u0131r\u0131n bulun xd yaz\u0131 yeterince uzad\u0131 zaten. Bu i\u015flem i\xe7in youtube videolar\u0131ndan da yararlanabilirsiniz.\n\n\xd6zet\n    Linux iyidir, ho\u015ftur ve kan\u0131mca her bilgisayar kullan\u0131c\u0131s\u0131n\u0131n denemesi gereken bir i\u015fletim sistemidir. \u0130ndirin, kullan\u0131n, pi\u015fman olmayacaks\u0131n\u0131z.\n\n\nKonuyla alakal\u0131 linkler\nhttps://www.linux.com/training-tutorials/myth-busting-linux-immune-viruses/\nhttps://www.gnu.org/gnu/manifesto.tr.html\nhttps://itsfoss.com/linux-gaming-guide/",B.yb),A.a5L("Gentoo neden vazge\xe7ilmez distrom ?","assets/images/if_it_moves_compile_it.png"," Merhaba, uzun bir aradan sonra tekrar bloguma bir \u015feyler ekliyorum. Bug\xfcn ciddi bir ara\u015ft\u0131rma yap\u0131p sa\u011flam bir konuyu ele almaktansa basit bir konu \xfczerinden ki\u015fisel zevklerimi a\xe7\u0131klamay\u0131 ve elitizm yapmay\u0131 tercih ettim. \xc7\xfcnk\xfc sadece \u015fu an bir \u015feyler yazmak istiyorum ve yazd\u0131\u011f\u0131m her neyse onu tamamlamak i\xe7in yakla\u015f\u0131k bir saatim var ve bug\xfcn yazd\u0131klar\u0131m\u0131 editlemek gibi bir niyetim de yok. Ne yazd\u0131ysam bug\xfcn burada duracak. Neden b\xf6yle bir challange'a giri\u015fti\u011fimi bilmiyorum, ama bundan keyif alaca\u011f\u0131m kesin. O y\xfczden \"Why not ?\"\n        \n    \"Linux ser\xfcvenim\" adl\u0131 yaz\u0131mda Gentoo kulland\u0131\u011f\u0131m\u0131 a\xe7\u0131klam\u0131\u015ft\u0131m, fakat detayl\u0131 bir \u015fekilde bunun sebeplerine indi\u011fimi hat\u0131rlam\u0131yorum. T\xfcm distrohopperlar (S\xfcrekli distro de\u011fi\u015ftirmekten a\u015f\u0131r\u0131 keyif alan ve bunu al\u0131\u015fkanl\u0131k haline d\xf6n\xfc\u015ft\xfcren insanlar) yeni bir distroya ge\xe7menin verdi\u011fi \u015fiddetli zevki bilir. Bu zevkten hen\xfcz haberi olmayanlar i\xe7in durumu k\u0131saca \xf6zetleyecek olursam, hayat\u0131n\u0131zda d\xf6nemsel olarak yaratt\u0131\u011f\u0131n\u0131z de\u011fi\u015fiklikleri d\xfc\u015f\xfcn\xfcn; imaj\u0131n\u0131zda bir de\u011fi\u015fiklik yapt\u0131\u011f\u0131n\u0131z\u0131, yapt\u0131\u011f\u0131n\u0131z gayriihtiyari k\u0131yafet al\u0131\u015fveri\u015flerini ve bunlardan ald\u0131\u011f\u0131n\u0131z zevki d\xfc\u015f\xfcnebilirsiniz. Distrohopping an\u0131nda ald\u0131\u011f\u0131n\u0131z \u015fiddetli zevk bir hafta ge\xe7meden ciddi bir can s\u0131k\u0131nt\u0131s\u0131na d\xf6n\xfc\u015febilir. Yeni challangelar, daha zorlu distrolar arayabilirsiniz. \u0130\u015fte Gentoo ile aramdaki toksik ili\u015fki tam olarak bu sebeple ba\u015flam\u0131\u015ft\u0131. \n\n    Gentoo kurulumu compile s\xfcreleri ve komplike yap\u0131s\u0131 sebebiyle saatler alan bir i\u015flem. Bu i\u015flemleri yaparken s\xfcrekli yeni \u015feyler \xf6\u011freniyordum. Anlayaca\u011f\u0131n\u0131z, tam bir dopamin bombard\u0131man\u0131 ya\u015f\u0131yordum. En nihayetinde bu i\u015flemler tamamland\u0131\u011f\u0131nda kendimi \xe7ok m\xfcthi\u015f bir i\u015f yapt\u0131\u011f\u0131m hususunda rahatl\u0131kla kand\u0131rabiliyordum. Distrohopping ser\xfcvenimdeki en keyifli an\u0131m kesinlikle Gentoo'yu kurdu\u011fum ilk and\u0131r. Amma ve lakin her zamanki gibi bir-iki hafta gibi bir s\xfcre i\xe7erisinde Gentoo'ya da al\u0131\u015fm\u0131\u015ft\u0131m ve Gentoo da benim i\xe7in s\u0131k\u0131c\u0131la\u015fmaya ba\u015flam\u0131\u015ft\u0131. \xd6n\xfcmde ne vard\u0131 ? \"Linux From Scratch\" diye bir proje... Bunun d\u0131\u015f\u0131nda herhalde Linux deneyimimi daha ilgin\xe7le\u015ftirecek bir \u015fey yoktu. Fakat projenin detaylar\u0131na bakt\u0131\u011f\u0131mda bunun asl\u0131nda gentoo kurulumundan a\u015f\u0131r\u0131 farkl\u0131 olmad\u0131\u011f\u0131n\u0131 fark ettim. Yine b\xfct\xfcn paketler derlenerek kuruluyordu, paket ba\u011f\u0131ml\u0131l\u0131klar\u0131n\u0131 kendi ellerimle halletmek zorundayd\u0131m vs. Tam olarak bu noktada linux ser\xfcvenimde ilk defa devreye \xfc\u015fenge\xe7li\u011fim girdi. Evet farkl\u0131 bir deneyim ya\u015fayacakt\u0131m fakat sonras\u0131 art\u0131k benim i\xe7in bir \xf6d\xfcl olmayacakt\u0131. A\xe7\u0131kcas\u0131 bir package manager olmadan linux kullanamazd\u0131m. Linux'a bu kadar ba\u011flanmam\u0131n ana sebeplerinden biri package manager mant\u0131\u011f\u0131n\u0131n pratikli\u011fiydi. Bu durumda daha ileriye gitmek bana ac\u0131 ve \u0131zd\u0131raptan ba\u015fka bir \u015fey getirmeyecekti. \u0130\u015fte i\xe7imdeki Distrohopping a\u015fk\u0131 bu \u015fekilde \xf6ld\xfc. Art\u0131k Linux'ta b\xf6yle k\xfc\xe7\xfck heyecanlar ya\u015fayamayacakt\u0131m. Zaten ya\u015fayacak vaktim de yoktu, \xf6n\xfcmde bir \xfcniversite s\u0131nav\u0131m vard\u0131 ve art\u0131k ona \xe7al\u0131\u015fmam gerekiyordu.\n\n     Nitekim, aradan bir s\xfcre ge\xe7ti \xfcniversiteye falan ba\u015flad\u0131m ve hi\xe7bir distroda Gentoo'da oldu\u011fu kadar rahat edemedi\u011fimi fark ettim. Bu y\xfczden Manjaro'ya tekrar ge\xe7meye ve bu durumun sebeplerini ayd\u0131nlatmaya karar verdim. \xd6ncelikle dikkatimi \xe7eken ilk durum Gnome'un 1-2 gb gibi kaynak yedi\u011fi olmu\u015ftu. Gentoo'da bu yakla\u015f\u0131k 400mb'ye denk geliyor. (tabi gnome, gnome-light paketi ile kurulursa) Bunu Manjaro'da da yapman\u0131n bir yolu mutlaka vard\u0131r ama Gentoo'da daha az zahmetliydi. Dimdirekt \"gnome-light\" paketini kurup i\u015fime bakabiliyordum. AUR paketleri aras\u0131nda gezinirken de bir durum dikkatimi \xe7ekmi\u015fti. Bir paket kurmak istiyordum ama kar\u015f\u0131mda o paketin bir\xe7ok versiyonu vard\u0131. Gentoo'da bu tarz de\u011fi\u015fiklikleri USE flagleriyle yapabiliyordum. Bir sonraki durum eselect komutu ve bunun sa\u011flad\u0131\u011f\u0131 rahatl\u0131kt\u0131. Mesela herhangi bir distroya lutris gibi bir ara\xe7 sayesinde rahatl\u0131kla farkl\u0131 wine s\xfcr\xfcmleri kurup keyfinize g\xf6re istedi\u011finizi yapabilirsiniz. Gentoo'da ise \"eselect wine list\" ile t\xfcm wine kurulumlar\u0131n\u0131z\u0131 g\xf6zlemleyebilir, \"eselect wine set x\" gibi bir komutla da istedi\u011finiz wine s\xfcr\xfcm\xfcne ge\xe7ebilirsiniz, ekstradan Lutris'e ihtiyac\u0131n\u0131z yok. Tabi bu sadece wine'da i\u015fe yaram\u0131yor; java, gcc, ruby gibi programlarda da bunu yapabiliyorsunuz. Bir kere benim i\xe7in s\u0131k\u0131nt\u0131 ya\u015fatan bir java s\xfcr\xfcm\xfcn\xfc, mevcut java s\xfcr\xfcm\xfcm\xfc silmeden, bir-iki komutta falan de\u011fi\u015ftirmi\u015ftim, Gentoo'nun b\xf6yle rahatl\u0131klar\u0131 var, di\u011fer distrolarda da vard\u0131r belki bilmiyorum :D\n\n     San\u0131r\u0131m Gentoo'da kalmam\u0131n ba\u015fka bir sebebi yok. Kendimi yukar\u0131da sayd\u0131\u011f\u0131m sebeplerden \xf6t\xfcr\xfc \xe7ok daha rahat hissediyorum. \xc7ok da a\xe7\u0131klayacak bir \u015feyim yokmu\u015f, onu bu yaz\u0131y\u0131 yazarken fark ettim. B\xfct\xfcn bunlar benim i\xe7in k\xfc\xe7\xfck ve yeterli sebepler. \u0130\u015fimi Gentoo'da rahatl\u0131kla g\xf6rebiliyorum, Gento bilgisayarlarla alakal\u0131 birka\xe7 tak\u0131nt\u0131ma da gayet tatmin edici cevaplar veriyor. \xd6yle i\u015fte... En iyisi siz bu yaz\u0131y\u0131 okudu\u011funuzu unutun, ben de bu yaz\u0131y\u0131 yazd\u0131\u011f\u0131m\u0131 unutay\u0131m. Ama bu yaz\u0131 burada dursun xd",B.xG),A.a5L("Linux Ser\xfcvenim","assets/images/gentoo_logo.png"," Merhabalar, bug\xfcn sizlere(!) Linux ser\xfcvenimi anlataca\u011f\u0131m. \n\nYakla\u015f\u0131k iki bu\xe7uk sene \xf6nce can\u0131m fazlaca s\u0131k\u0131ld\u0131\u011f\u0131 i\xe7in ilk defa i\u015fletim sistemim olarak linux kullanmaya karar verdim. Daha da \xf6nce \"hek\u0131r\" triplerine girerek (\xe7ok k\xfc\xe7\xfckt\xfcm :P) yalandan usbye Tails yaz\u0131p \"dib web\" e girmi\u015fli\u011fim vard\u0131 ve linux ile tan\u0131\u015f\u0131kl\u0131\u011f\u0131m bundan ibaretti. \u0130nternette \"Linux Mint\" diye bir distro bulmu\u015ftum ve yeni ba\u015flayanlara genelde o \xf6neriliyordu. Pek bi bilin\xe7sizce \"Mate\" versiyonunu indirip elime gelen ilk usbye Linux Mint Mate'i yazm\u0131\u015ft\u0131m ve \"NEXT NEXT NEXT\" diyerek kurmu\u015ftum. \xdczerimde tamamen yeni bir mecraya at\u0131lman\u0131n tatl\u0131 heyecan\u0131 vard\u0131\n\nDikkatimi \xe7eken ilk \u015fey bilgisayar\u0131m\u0131n daha h\u0131zl\u0131 oldu\u011fuydu, g\xf6rsellik de Windows 10'a g\xf6re daha iyiydi sanki (en az\u0131ndan benim g\xf6z\xfcme daha g\xfczel geliyor).\n\n    Play Store gibi bi ma\u011fazam\u0131n olmas\u0131 ho\u015fuma gitmi\u015fti. (Yaz\u0131k, terminalin rahatl\u0131\u011f\u0131ndan haberi yok hen\xfcz) Steam'i indirip Half-Life 1, CS:GO gibi oyunlar\u0131 denemi\u015ftim. Oyun performans\u0131 Windows'a g\xf6re biraz d\xfc\u015f\xfckt\xfc ama arada devasa bir fark yoktu. Wine'\u0131 (Windows Emulator\xfc, a\xe7\u0131l\u0131m\u0131 aksini iddia etse de ben b\xf6yle diyorum) da ke\u015ffettikten sonra ciddi ciddi g\xfcnl\xfck i\u015fletim sistemim olarak Linux Mint kullanabilece\u011fimi d\xfc\u015f\xfcnm\xfc\u015ft\xfcm. Mate'i keyfime g\xf6re ki\u015fiselle\u015ftirmek de Linux kullanma fikrimi kuvvetlendirmi\u015fti.\n\n    Ortaya ger\xe7ekten estetik ve h\u0131zl\u0131 bir i\u015fletim sistemi \xe7\u0131km\u0131\u015ft\u0131, ama sonras\u0131nda baz\u0131 oyunlar\u0131n wine ile a\xe7\u0131lmad\u0131\u011f\u0131n\u0131 veya Linux ile pek uyumlu olmad\u0131\u011f\u0131n\u0131 fark etmi\u015ftim. 1 y\u0131l gibi bir s\xfcre Linux Mint kullanm\u0131\u015f, s\u0131rf oyunlar\u0131m i\xe7in Windows'a geri d\xf6nmeye karar vermi\u015ftim. Tekrardan Windows'a d\xf6n\xfcp biraz vakit ge\xe7irdikten sonra Windows'u y\u0131llarca nas\u0131l kulland\u0131\u011f\u0131m\u0131 d\xfc\u015f\xfcnd\xfcm. Art\u0131k Windows'tan tiksiniyordum, Windows benim i\xe7in lanetliydi, Ama b\xfct\xfcn oyunlar\u0131m Windows'ta kusursuz \xe7al\u0131\u015f\u0131yordu. Linux'a tekrar ge\xe7me iste\u011fim sorunsuz bir \u015fekilde oyun oynama iste\u011fime g\xf6re daha a\u011f\u0131r bas\u0131yordu. (Sonras\u0131nda oyun oynama iste\u011fi daha a\u011f\u0131r basacak ve bu bir k\u0131s\u0131r d\xf6ng\xfcy\xfc ba\u015flatacak) Bir yandan di\u011fer distrolar\u0131 da denemek istiyordum. (i\u015fte tam olarak bu noktada hayat\u0131m kayd\u0131 :)) ) Bir\xe7ok Linux distrosu deneyip bir\xe7o\u011funu kuramam\u0131\u015f, kurduklar\u0131mda da birtak\u0131m problemler ya\u015f\u0131yordum. (wifi g\xf6rm\xfcyor, FANLARIM A\u015eIRI SESL\u0130 \xc7ALI\u015eIYOR, NVIDIA driverlar\u0131m neden kurulmuyor gibi, bunlar\u0131n \xe7\xf6z\xfcm\xfcn\xfc ve sebebini uzun zaman sonra \xf6\u011frenece\u011fim) Son \xe7are olarak Linux Mint'e geri d\xf6nm\xfc\u015ft\xfcm.\n\n    Herhalde problemlerimi \xe7\xf6zmek i\xe7in youtubeta yapt\u0131\u011f\u0131m aramalardan olsa gerek, Youtube algoritmas\u0131 kar\u015f\u0131ma Linux ile alakal\u0131 videolar \xe7\u0131karmaya ba\u015flam\u0131\u015ft\u0131. Allah'\u0131n belas\u0131, kanserojen Linux komm\xfcnitesinde d\xf6nen muhabbetleri takip etmeye ba\u015flam\u0131\u015ft\u0131m. \u0130nternette g\xf6rd\xfc\u011f\xfcm kuul reyizler hep \"Arch Linux\" diye bir i\u015fletim sistemi kullan\u0131yordu. Ben de Arch kurup onlar kadar kuul olmal\u0131yd\u0131m ! Youtube'dan Arch kurulumu videosu a\xe7\u0131p videodakileri bire bir yazarak Arch kurmay\u0131 denemi\u015ftim (lol), hangi ad\u0131mda tak\u0131ld\u0131\u011f\u0131m\u0131 hat\u0131rlam\u0131yorum ama becerememi\u015ftim. Birka\xe7 denemeden sonra ba\u015far\u0131l\u0131 olmu\u015f; ancak klavye dilini, wifi ye nas\u0131l ba\u011flanaca\u011f\u0131m\u0131, EKRAN KARTI FANIMIN NEDEN FULL SES \xc7ALI\u015eTI\u011eINI vs \xe7\xf6zebilmi\u015f de\u011fildim. Yine Linux Mint'e geri d\xf6nm\xfc\u015ft\xfcm.\n\n    Sonra \"Arch simplified\" mentalitesini takip eden bir distro ke\u015ffettim, \"Manjaro Linux\". Rahat\xe7a kurmay\u0131 ba\u015farsam da Arch'ta kar\u015f\u0131la\u015ft\u0131\u011f\u0131m t\xfcm problemleri Manjaro'da da ya\u015fad\u0131\u011f\u0131m\u0131 fark ettim, fakat manjaroda wifi chipsetimi yay'da aratm\u0131\u015f ve gerekli driverlar\u0131 bulmu\u015ftum, dkms falan \"bi\u015filer\" olduktan sonra Wifi problemi \xe7\xf6z\xfclm\xfc\u015ft\xfc. Bundan sonra akl\u0131ma Windows'ta ekran kart\u0131 driverlar\u0131m\u0131 y\xfcklerken kar\u015f\u0131la\u015ft\u0131\u011f\u0131m problemler gelmi\u015fti, \"Nvidia-390\" yazan driver\u0131 y\xfcklemeyi denemi\u015ftim ve fan sesi mevzusu da \xe7\xf6z\xfclm\xfc\u015ft\xfc. Bunu Manjaro'da yapt\u0131ysam Arch'ta da yapabilmeliydim.. Yapamad\u0131m, \xe7\xfcnk\xfc pacui ve yay Arch'ta YOKTU (xd) Manjaro'ya geri d\xf6nm\xfc\u015ft\xfcm (komfor alan\u0131 de\u011fi\u015fti).\n\n\n\n    Uzun bir s\xfcre Manjaro kulland\u0131m, windows-manjaro aras\u0131 tak\u0131l\u0131rken pacman, git, makepkg -si gibi komutlara da iyice al\u0131\u015fm\u0131\u015ft\u0131m. ARTIK Arch'\u0131 rahat\xe7a kurabilirdim, kurdum da. DE'yi de kurduktan sonra \"Bu muydu ?\" dedi\u011fimi hat\u0131rl\u0131yorum. Arch kullanmak pek de \xf6zel bir \u015fey de\u011fildi, hep memelerin kayna\u011f\u0131n\u0131n Arch'\u0131n kullan\u0131m\u0131n\u0131n zor oldu\u011fundan kaynakland\u0131\u011f\u0131n\u0131 d\xfc\u015f\xfcn\xfcrd\xfcm, olaylara basbaya\u011f\u0131 mal gibi yakla\u015fm\u0131\u015f\u0131m. Bununla beraber Arch'\u0131 a\u015f\u0131r\u0131 kullan\u0131c\u0131 dostu bulmu\u015ftum, minimalizm kavram\u0131na ve pacman'e a\u015f\u0131k olmu\u015ftum. \n\nMutlu son !! \n\n    Diyece\u011fimi sanmad\u0131n\u0131z biliyorum ama hen\xfcz ser\xfcvenim sona ermemi\u015fti ve bunu bir ters k\xf6\u015feymi\u015f gibi sunmal\u0131yd\u0131m, halen daha di\u011fer distrolar\u0131 merak ediyordum. Baz\u0131 ismi lazm\u0131 olmayan ubuntu t\xfcrevlerini, Fedora'y\u0131 (Hala daha t\xfcm benli\u011fimle tiksiniyorum), Manjaro'yu, ismi laz\u0131m olmayan baz\u0131 Arch t\xfcrevlerini deniyor ve en sonunda Arch'a geri d\xf6n\xfcyordum.(komfor alan\u0131 g\xfcncellendi)\n\n    Nosystemd fa\u015fistli\u011fi/feti\u015fizmi neydi ? Her \u015feyden \xf6nce systemd neydi ? Bu sorular\u0131n cevab\u0131n\u0131 ararken kar\u015f\u0131ma birka\xe7 distro \xe7\u0131kt\u0131. Arch sevgimden ve Luke Smith reyizden yola \xe7\u0131karak Artix'i denedim. Tabi ki birka\xe7 problemle kar\u015f\u0131la\u015ft\u0131m. (ekran parlakl\u0131\u011f\u0131 kaydedilmiyor, service management ne acaba ?) Problemlerimi \xe7\xf6zd\xfckten sonra \"\u0130nit sistem nedir ?\" sorusunun cevab\u0131n\u0131 alm\u0131\u015ft\u0131m. Nosystemd fa\u015fistleri k\u0131smen hakl\u0131yd\u0131, bilgisayar\u0131m daha az kaynak kullan\u0131yordu ve bilgisayar\u0131m \xfczerinde daha fazla kontrole sahip oldu\u011fumu hissediyordum. Sonradan Arch'a d\xf6nd\xfc\u011f\xfcmde systemd'nin di\u011fer init sistemlere g\xf6re fazla komplike oldu\u011funu, pek kullanmad\u0131\u011f\u0131m bile\u015fenler bar\u0131nd\u0131rd\u0131\u011f\u0131n\u0131 fark ettim.(systemd-boot, systemd-cron journalctl systemd-zart.zurt) Ama bununla beraber yan\u0131nda bir\xe7ok kolayl\u0131\u011f\u0131 da getiriyordu. Systemd'den nefret etmemekle beraber kullanmay\u0131 tercih etmeyecektim. Artix'e geri d\xf6nd\xfcm. (yeni komfor alan\u0131 a\xe7\u0131ld\u0131)\n\n    \"Denemedi\u011fim hatr\u0131 say\u0131l\u0131r bir distro kald\u0131 m\u0131 ?\" derken nihayet kar\u015f\u0131ma gentoo \xe7\u0131kt\u0131. Oleey yeni bir distro diyerek hemen gentoo kurulumuna ba\u015flad\u0131m. Komut sat\u0131r\u0131n\u0131 g\xf6r\xfcnce akl\u0131ma ilk arch ayar\u0131nda bir distro oldu\u011fu gelmi\u015fti, ama \xf6yle de\u011fildi. Kurulum s\xfcreci Arch'a g\xf6re baya\u011f\u0131 komplikeydi, paket kurulum s\xfcreleri (NEDEN ACABA) daha uzundu. Bu tabi ki beni vazge\xe7irmedi, karmakar\u0131\u015f\u0131k rehberlerle ilgilenmek yerine tabi ki youtube videolar\u0131 izleyerek  (\u015fu ok zehirli i\u015fte \u015funu atma ya) sistemimi kurmaya \xe7al\u0131\u015ft\u0131m. Her seferinde ba\u015far\u0131s\u0131z oluyor ama kurulumu bir sonraki safhaya ta\u015f\u0131yordum. Bir keresinde kurmay\u0131 ba\u015fard\u0131m, ama wifi driverlar\u0131m\u0131 ve ekran kart\u0131 driver\u0131m\u0131 kurmay\u0131 becerememi\u015ftim, startx komutunu da rootsuz \xe7al\u0131\u015ft\u0131ramay\u0131nca gentoo'ya bir s\xfcreli\u011fine ara verdim ve Artix'e geri d\xf6nd\xfcm.\n\n    Gentoo di\u011fer distrolara g\xf6re \xe7ok daha performansl\u0131 ve ki\u015fiselle\u015ftirilebilir olmas\u0131yla baya\u011f\u0131 ilgimi \xe7ekiyordu. Ayn\u0131 zamanda ram kullan\u0131m\u0131 da di\u011fer distrolara g\xf6re daha azd\u0131. Tam olarak bu y\xfczden Gentoo benim i\xe7in bir tak\u0131nt\u0131ya d\xf6n\xfc\u015fm\xfc\u015ft\xfc. Kesinlikle kurulumunu tekrar denemeliydim. Bu sefer youtube videolar\u0131n\u0131 bir kenara b\u0131rak\u0131p handbook'u ba\u015ftan sona dikkatlice takip etmeyi tercih etmi\u015ftim, en ba\u015f\u0131ndan beri problemim de buymu\u015f zaten. Genkernel kullanmak d\u0131\u015f\u0131nda bir g\xfcnah i\u015flememi\u015ftim. Nihayet istedi\u011fim sisteme eri\u015fmi\u015ftim. Kernel ayarlar\u0131m\u0131 yapmak, use flaglerimi ayarlamak,  buna g\xf6re t\xfcm sistemimi i\u015flemci mimarime/flaglerine g\xf6re derlemek \xe7ok tatmin ediciydi. Portage m\xfckemmel bir paket y\xf6neticisiydi ve her ihtiyac\u0131ma yan\u0131t veriyordu. Her \u015fey a\u015f\u0131r\u0131 stabildi ve Gentoo'ya \xf6lesiye ba\u011flanm\u0131\u015ft\u0131m. (Tek problemi paketlerin derlenme s\xfcresi :P)\n\n    Son 8 ayd\u0131r Gentoo kullan\u0131yorum ve Linux'un nas\u0131l \xe7al\u0131\u015ft\u0131\u011f\u0131yla alakal\u0131 bir\xe7ok detay\u0131 bu 8 ayl\u0131k s\xfcre\xe7te \xf6\u011frendim. \u015eu an... Windows kullan\u0131yorum. Neden ? Linux'ta GTA V'te ve Dying Light'de daha iyi bir performans alabilmek i\xe7in. Ayn\u0131 zamanda en ac\u0131l\u0131 Windows s\xfcrecimi ya\u015f\u0131yorum, Windows program yazmak i\xe7in Linux kadar pratik de\u011filmi\u015f... Ayn\u0131 zamanda sistemim Windows standartlar\u0131na g\xf6re h\u0131zl\u0131 olsa da \u015fu an bana a\u015f\u0131r\u0131 yava\u015f geliyor, uzun s\xfcredir wm kullanan biri olarak masa\xfcst\xfcne tekrar adapte olmaya \xe7al\u0131\u015f\u0131yorum. (birka\xe7 ay sonra gelen edit, yine gentoo kullan\u0131yorum)\n\n    Neyse, ikinci blog yaz\u0131m\u0131n sonuna gelmi\u015f bulunmaktay\u0131m. B\xfct\xfcn bunlar\u0131 belki gelecekte beni k\xf6t\xfc g\xfcnler bekliyordur, gelecekteki Tayfun bunlar\u0131 okusun da az\u0131c\u0131k ne\u015fesi yerine gelsin diye yaz\u0131yorum. Bunlar\u0131n bana hi\xe7bir yarar\u0131 dokunmasa da, hat\u0131ra olarak kalmalar\u0131 yeterli.\n\nG\xf6r\xfc\u015fmek \xfczere.\n\n\n",B.yd)],A.R("o<yn>")))
